import { GET_MOVEMENTS } from '../actions/constants.js';

const getMovementsReducer = (state = {name: {}}, action) => {
    switch (action.type) {
        case GET_MOVEMENTS:
            return action.name
        default:
            return state;
    }
};

export default getMovementsReducer;
